import PropTypes from "prop-types"

function Food({food_name, image, raiting}) { //({}) is props
  return (
    <div>
      <h3>Моя любимая еда - это {food_name}!!!</h3>
      <img src={image} />
      <h4>{raiting}/5</h4>
    </div>
  )
}

Food.propTypes = {
  food_name: PropTypes.string.isRequired,
  image: PropTypes.string.isRequired,
  raiting: PropTypes.string.isRequired
}

const my_like_food = [
  {
    "id": 1,
    "name": "пельмени",
    "image": "https://upload.wikimedia.org/wikipedia/commons/thumb/d/df/Pelmeni_Russian.jpg/274px-Pelmeni_Russian.jpg",
    "raiting": 4.5,
  },
  {
    "id": 2,
    "name": "бутерброды",
    "image": "https://www.vsegdavkusno.ru/assets/images/recipes/2929/image_565/goryachiy-buterbrod-na-skovorode3-1.jpg",
    "raiting": 4.9,
  },
  {
    "id": 3,
    "name": "стейки",
    "image": "https://ferma-m2.ru/images/shop/recipe_image/crop_1_1_2.jpg",
    "raiting": 3.9,
  }
]

function render_food(dish) {
  return <Food key={dish.id} 
               food_name={dish.name} 
               image={dish.image}
               raiting={dish.raiting}
          />
}

function App() {
  return (
    <div>
      {my_like_food.map(render_food)}
    </div>
  );
}

export default App;
